import React from 'react';



export var data = 
[
    {   
        code: "1111",
        location: "Oulu",
        fastcharge: true,
        pricing: 2, // 0 = Free, 1 = 20c/minute, 2= 18c/kWh
        available: true ,
        kW: 150
        
    },
    {   
        code: "2222",
        location: "Tampere",
        fastcharge: false,
        pricing: 0, // 0 = Free, 1 = 20c/minute, 2= 18c/kWh
        available: true,
        kW: 22
    },
    {   
        code: "5555",
        location: "Helsinki",
        fastcharge: false,
        pricing: 1, // 0 = Free, 1 = 20c/minute, 2= 18c/kWh
        available: true,
        kW: 22 
    },
    {   
        code: "7777",
        location: "Oulu",
        fastcharge: true,
        pricing: 2, // 0 = Free, 1 = 20c/minute, 2= 18c/kWh
        available: false,
        kW: 70 
    }

];


export var historyEntrys =
[
    {
        code: "0000",
        location: "Oulu",
        timeStart: new Date(2018, 11, 24, 10, 33, 30),
        duration: 50,
        kW: 5,
        pricing: 1
    },
    {
        code: "1111",
        location: "Helsinki",
        timeStart: new Date(2018, 11, 27, 10, 33, 30),
        duration: 50,
        kW: 5,
        pricing: 1
    },
    {
        code: "1234",
        location: "Kokola",
        timeStart: new Date(2018, 11, 25, 10, 33, 30),
        duration: 50,
        kW: 5,
        pricing: 1
    }
];
